import React from 'react';
import { motion } from 'framer-motion';
import { useNavigate } from 'react-router-dom';
import { Brain, Sparkles, MessageCircle, Zap, Users, Shield } from 'lucide-react';
import Header from '../components/Header';
import Footer from '../components/Footer';

const LandingPage: React.FC = () => {
  const navigate = useNavigate();

  const features = [
    {
      icon: <Brain className="w-8 h-8" />,
      title: "Intelligent Conversations",
      description: "Engage with AI that understands context and nuance"
    },
    {
      icon: <Sparkles className="w-8 h-8" />,
      title: "Creative Assistance",
      description: "Unlock your creativity with AI-powered brainstorming"
    },
    {
      icon: <MessageCircle className="w-8 h-8" />,
      title: "Natural Communication",
      description: "Chat naturally with responses that feel human"
    },
    {
      icon: <Zap className="w-8 h-8" />,
      title: "Lightning Fast",
      description: "Get instant responses to your queries and requests"
    },
    {
      icon: <Users className="w-8 h-8" />,
      title: "Personalized Experience",
      description: "AI that adapts to your unique style and preferences"
    },
    {
      icon: <Shield className="w-8 h-8" />,
      title: "Privacy First",
      description: "Your conversations are secure and private"
    }
  ];

  const testimonials = [
    {
      name: "Sarah Chen",
      role: "Creative Director",
      content: "Soul has transformed how I approach creative projects. It's like having a brilliant collaborator available 24/7."
    },
    {
      name: "Marcus Rodriguez",
      role: "Software Engineer",
      content: "The clarity and depth of Soul's responses are remarkable. It's become an essential part of my workflow."
    },
    {
      name: "Emily Watson",
      role: "Writer",
      content: "Soul doesn't just answer questions—it helps me think through complex ideas and find new perspectives."
    }
  ];

  return (
    <div className="min-h-screen relative overflow-hidden">
      <Header />

      {/* Smoke Background */}
      <div className="smoke-background"></div>

      {/* Hero Section */}
      <section className="pt-32 pb-20 px-4 relative overflow-visible" style={{position: 'relative', zIndex: 1}}>
        {/* Main smoke effects */}
        <div className="smoke-left" style={{zIndex: 1}}></div>
        <div className="smoke-right" style={{zIndex: 1}}></div>

        {/* Left side smoke particles with variants */}
        <div className="smoke-particle" style={{left: '10%', top: '20%', animationDelay: '0s', zIndex: 1}}></div>
        <div className="smoke-particle variant-1" style={{left: '15%', top: '30%', animationDelay: '2s', zIndex: 1}}></div>
        <div className="smoke-particle variant-2" style={{left: '5%', top: '40%', animationDelay: '4s', zIndex: 1}}></div>
        <div className="smoke-particle variant-3" style={{left: '20%', top: '25%', animationDelay: '6s', zIndex: 1}}></div>
        <div className="smoke-particle variant-1" style={{left: '8%', top: '35%', animationDelay: '8s', zIndex: 1}}></div>
        <div className="smoke-particle variant-2" style={{left: '12%', top: '45%', animationDelay: '10s', zIndex: 1}}></div>
        <div className="smoke-particle variant-3" style={{left: '18%', top: '15%', animationDelay: '3s', zIndex: 1}}></div>
        <div className="smoke-particle variant-1" style={{left: '7%', top: '28%', animationDelay: '7s', zIndex: 1}}></div>

        {/* Center smoke particles */}
        <div className="smoke-particle variant-3" style={{left: '45%', top: '10%', animationDelay: '2s', zIndex: 1}}></div>
        <div className="smoke-particle variant-2" style={{left: '55%', top: '15%', animationDelay: '5s', zIndex: 1}}></div>
        <div className="smoke-particle variant-1" style={{left: '48%', top: '25%', animationDelay: '8s', zIndex: 1}}></div>
        <div className="smoke-particle variant-3" style={{left: '52%', top: '35%', animationDelay: '11s', zIndex: 1}}></div>

        {/* Right side smoke particles with variants */}
        <div className="smoke-particle" style={{right: '10%', top: '20%', animationDelay: '1s', zIndex: 1}}></div>
        <div className="smoke-particle variant-1" style={{right: '15%', top: '30%', animationDelay: '3s', zIndex: 1}}></div>
        <div className="smoke-particle variant-2" style={{right: '5%', top: '40%', animationDelay: '5s', zIndex: 1}}></div>
        <div className="smoke-particle variant-3" style={{right: '20%', top: '25%', animationDelay: '7s', zIndex: 1}}></div>
        <div className="smoke-particle variant-1" style={{right: '8%', top: '35%', animationDelay: '9s', zIndex: 1}}></div>
        <div className="smoke-particle variant-2" style={{right: '12%', top: '45%', animationDelay: '11s', zIndex: 1}}></div>
        <div className="smoke-particle variant-3" style={{right: '18%', top: '15%', animationDelay: '4s', zIndex: 1}}></div>
        <div className="smoke-particle variant-1" style={{right: '7%', top: '28%', animationDelay: '8s', zIndex: 1}}></div>

        {/* Additional smoke particles for more coverage */}
        <div className="smoke-particle variant-2" style={{left: '25%', top: '50%', animationDelay: '1.5s', zIndex: 1}}></div>
        <div className="smoke-particle variant-3" style={{left: '35%', top: '55%', animationDelay: '3.5s', zIndex: 1}}></div>
        <div className="smoke-particle variant-1" style={{left: '65%', top: '50%', animationDelay: '5.5s', zIndex: 1}}></div>
        <div className="smoke-particle variant-2" style={{left: '75%', top: '55%', animationDelay: '7.5s', zIndex: 1}}></div>

        <div className="max-w-6xl mx-auto text-center relative z-10 text-white">
          <motion.h1 
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            className="text-6xl md:text-7xl font-bold mb-6 tracking-tight"
          >
            AI with <span className="text-accent-blue">Soul</span>
          </motion.h1>

          <motion.p 
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.2 }}
            className="text-xl md:text-2xl text-gray-200 mb-12 max-w-3xl mx-auto leading-relaxed"
          >
            Your intelligent companion for work, creativity, and clarity.
          </motion.p>

          <motion.div 
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.4 }}
            className="flex flex-col sm:flex-row gap-4 justify-center"
          >
            <button 
              onClick={() => navigate('/onboarding')}
              className="px-8 py-4 bg-gradient-to-r from-teal-500 to-blue-600 text-white rounded-lg font-semibold text-lg hover:from-teal-600 hover:to-blue-700 transition-all duration-200 shadow-lg"
            >
              Try Soul
            </button>
            <button 
              onClick={() => navigate('/chat')}
              className="px-8 py-4 border-2 border-teal-500 text-white rounded-lg font-semibold text-lg hover:bg-teal-500/20 transition-all duration-200 shadow-lg"
            >
              Sign In
            </button>
          </motion.div>
        </div>
      </section>

      {/* Features Section */}
      <section className="py-20 px-4 relative z-10 bg-black bg-opacity-50 text-white">
        <div className="max-w-6xl mx-auto">
          <motion.h2 
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            className="text-4xl md:text-5xl font-bold text-center mb-16"
          >
            Features
          </motion.h2>

          <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
            {features.map((feature, index) => (
              <motion.div 
                key={index}
                initial={{ opacity: 0, y: 20 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                className="bg-black bg-opacity-40 p-8 rounded-xl shadow-sm hover:shadow-md transition-shadow duration-200 border border-teal-500/30"
              >
                <div className="text-accent-blue mb-4">{feature.icon}</div>
                <h3 className="text-xl font-semibold mb-3">{feature.title}</h3>
                <p className="text-gray-200">{feature.description}</p>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* How it Works Section */}
      <section className="py-20 px-4 relative z-10 bg-black bg-opacity-30 text-white">
        <div className="max-w-6xl mx-auto">
          <motion.h2 
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            className="text-4xl md:text-5xl font-bold text-center mb-16"
          >
            How it Works
          </motion.h2>

          <div className="grid md:grid-cols-3 gap-12">
            <motion.div 
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6 }}
              className="text-center"
            >
              <div className="w-16 h-16 bg-accent-blue text-white rounded-full flex items-center justify-center text-2xl font-bold mx-auto mb-6">1</div>
              <h3 className="text-xl font-semibold mb-4">Start Chatting</h3>
              <p className="text-gray-200">Simply type your question or request in natural language</p>
            </motion.div>

            <motion.div 
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: 0.2 }}
              className="text-center"
            >
              <div className="w-16 h-16 bg-accent-blue text-white rounded-full flex items-center justify-center text-2xl font-bold mx-auto mb-6">2</div>
              <h3 className="text-xl font-semibold mb-4">AI Understands</h3>
              <p className="text-gray-200">Soul processes your request with deep understanding and context</p>
            </motion.div>

            <motion.div 
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: 0.4 }}
              className="text-center"
            >
              <div className="w-16 h-16 bg-accent-blue text-white rounded-full flex items-center justify-center text-2xl font-bold mx-auto mb-6">3</div>
              <h3 className="text-xl font-semibold mb-4">Get Results</h3>
              <p className="text-gray-200">Receive thoughtful, accurate responses tailored to your needs</p>
            </motion.div>
          </div>
        </div>
      </section>

      {/* Testimonials Section */}
      <section className="py-20 px-4 relative z-10 bg-black bg-opacity-50 text-white">
        <div className="max-w-6xl mx-auto">
          <motion.h2 
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            className="text-4xl md:text-5xl font-bold text-center mb-16"
          >
            Testimonials
          </motion.h2>

          <div className="grid md:grid-cols-3 gap-8">
            {testimonials.map((testimonial, index) => (
              <motion.div 
                key={index}
                initial={{ opacity: 0, y: 20 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                className="bg-black bg-opacity-40 p-8 rounded-xl shadow-sm hover:shadow-md transition-shadow duration-200 border border-teal-500/30"
              >
                <p className="text-gray-200 mb-6 italic">"{testimonial.content}"</p>
                <div>
                  <p className="font-semibold">{testimonial.name}</p>
                  <p className="text-sm text-gray-300">{testimonial.role}</p>
                </div>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="py-20 px-4 relative z-10 bg-gradient-to-r from-teal-500/70 to-blue-600/70 text-white">
        <div className="max-w-4xl mx-auto text-center">
          <motion.h2 
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            className="text-4xl md:text-5xl font-bold mb-8"
          >
            Ready to Experience AI with Soul?
          </motion.h2>

          <motion.p
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.2 }}
            className="text-xl mb-12 max-w-2xl mx-auto"
          >
            Join thousands of users who have transformed their workflow with our intelligent AI companion.
          </motion.p>

          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.4 }}
          >
            <button 
              onClick={() => navigate('/onboarding')}
              className="px-8 py-4 bg-white text-blue-600 rounded-lg font-semibold text-lg hover:bg-gray-100 transition-colors duration-200 shadow-lg"
            >
              Get Started Now
            </button>
          </motion.div>
        </div>
      </section>

      <Footer />
    </div>
  );
};

export default LandingPage;
